import React from "react";
import "../css/Feed.css";
import {
    IconSearch,
    IconHome,
    IconUsersGroup,
    IconBuildingStore,
    IconMenu2,
    IconMessages,
    IconBell,
    IconUserCircle,
  } from "@tabler/icons-react";

function Feed() {
  return (
    <div className="main">
      <div className="right-side">
        <div className="profile">
          <img
            src="/images/avatar-1.jpeg"
            alt="profile-picture"
            style={{ height: "50px", padding: "1rem" }}
          />
          FirstName LastName
        </div>
        <div className="friends">
            <IconUsers stroke={2} />
        </div>
        <div className="events">

        </div>
        <div className="pages">

        </div>
        <div className="fundraisers">

        </div>
      </div>
      <div className="timeline">Feed</div>
      <div className="left-side">Friends</div>
    </div>
  );
}

export default Feed;
